def special_factorial(n):
    def factorial(x):
        if x == 0 or x == 1:
            return 1
        else:
            return x * factorial(x-1)

    result = 1
    for i in range(1, n+1):
        result *= factorial(i)
    return result

def words_in_sentence(sentence):
